import { useNavigate } from "react-router-dom";

const DashboardPage = () => {
  const navigate = useNavigate();
  const handleMenuCLick = () => {
    navigate("/menu");
  };
  return (
    <>
      <h1>To menu</h1>
      <div>
      <button className="btn btn-primary mx-auto" onClick={handleMenuCLick}>
        Menu
      </button>
      </div>
    </>
  );
};

export default DashboardPage;
